import React from "react";
import "./App.css";

class Painting extends React.Component {
  render() {
    return (
      <div>
        <p style={{ backgroundColor: this.props.dominantColour }}>
          {this.props.title}
        </p>
      </div>
    );
  }
}

export default Painting;
